import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

function MainBannerContent() {
	return (
		<ComponentWrapper>
			<div className="ImageWrapper">
				<img
					src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Fbanners%2F1680%2Fbdb407ab.jpg&amp;w=1060&amp;q=100"
					alt="대규모 신입 채용 프로젝트"
				/>
			</div>
			<div>
				<h2>대규모 신입 채용 프로젝트</h2>
				<h3>유니콘·스타트업 채용공고에 지원하세요!</h3>
				<hr />
				<Link to="/events/newcomerwanted">
					<span className="Button_Button__label__1Kk0v">
						바로가기
						<span className="Button_Button__endIcon__MpDfc">
							<span className="SvgIcon_SvgIcon__root__8vwon">
								<svg
									className="SvgIcon_SvgIcon__root__svg__DKYBi"
									viewBox="0 0 18 18"
								>
									<path d="m11.955 9-5.978 5.977a.563.563 0 0 0 .796.796l6.375-6.375a.563.563 0 0 0 0-.796L6.773 2.227a.562.562 0 1 0-.796.796L11.955 9z" />
								</svg>
							</span>
						</span>
					</span>
				</Link>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	width: 100%;
	display: inline-block;
	.ImageWrapper {
		position: relative;
		padding-bottom: 28.3%;
		/* filter: brightness(50%); */
		img {
			position: absolute;
			width: 100%;
			height: 100%;
			left: 0;
			top: 0;
			border-radius: 4px;
			object-fit: cover;
		}
	}
`;

export default MainBannerContent;
